import React from 'react';
import { Row, Col, Container } from 'react-bootstrap';
import Layout from '../../components/Layout';
import './style.css';

/**
* @author
* @function Home
**/

const Home = (props) => {
    return (
        <Layout>
            <Container fluid>
                <Row>

                    <Col md={10} style={{ marginLeft: 'auto'}}>Container</Col>
                </Row>
            </Container>

        </Layout>
    )

}

export default Home;
